import { Card, Avatar } from "@mui/material";

type MatchCardProps = any;

export default function MatchCard(props: MatchCardProps) {
  return (
    <Card sx={{
      height: '15vh', 
      border: 'solid',
      borderRadius: '3.5vw',
      display: 'flex',
      flex: 'column',
      margin: '1vh',
    }}>
      <Avatar
        alt="장원영"
        src="./13131.jpeg"
        sx={{ 
          width: '10vh', 
          height: '10vh',
          margin: '0.5rem',
        }}
      />

    </Card>
  )
}
